var geojsonMarkerOptions = {
	radius: 3,
	fillColor: "#ff7800",
	color: "#000",
	weight: 1,
	opacity: 1,
	fillOpacity: 0.8
};

function onEachFeature(feature, layer) {
    // does this feature have a property named popupContent?
    if (feature.properties && feature.properties.road_name) {
        layer.bindPopup(feature.properties.road_name);
    }
}

function onEachFeatureBikeshare(feature, layer) {
    // does this feature have a property named popupContent?
    if (feature.properties && feature.properties.data__stations__name) {
        layer.bindPopup(feature.properties.data__stations__name);
    }
}

L.tileLayer('https://{s}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}{r}.png', {
	attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors &copy; <a href="https://carto.com/attributions">CARTO</a>',
	subdomains: 'abcd',
	maxZoom: 20
}).addTo(map);

L.geoJSON(bikelanes, {
	style: function(feature) {
        switch (feature.properties.facility) {
            case 'On Road - Dedicated Bike Lanes': return {color: "#00C837"};
			case 'On Road - Shared-Lane Markings': return {color: "0088C8"};
			case 'On Road - Dedicated Lanes with Contraflow': return {color: "#C81E00"};
            case 'Off Street - Multi-Use Path':   return {color: "#0000ff"};
        }
    }, onEachFeature
}, ).addTo(map)

L.geoJSON(reddyStations, {
    pointToLayer: function (feature, latlng) {
        return L.circleMarker(latlng, geojsonMarkerOptions);
    }, onEachFeature: onEachFeatureBikeshare
}).addTo(map);